import React from 'react'
import {Data} from  "../data"

const QNA = () => {
  return (
    <>
    <div className="accordion">
        {Data.map((item,i)=>{
            <div className="item">
                <div className="question">
                    <h2>{item.question}</h2>
                </div>
                <div className="answer">
                    <p>{item.answer}</p>
                </div>
            </div>
        })}
    </div>
    </>
  )
}

export default QNA
